import React, { useState } from "react";
import FacebookLogin from "react-facebook-login";

const MyApp = () => {
  const [profile, setProfile] = useState(null);

  const responseFacebook = (response) => {
    if (response.status !== "unknown") setProfile({ name: response.name });
    else console.error("Facebook login failed:", response);
  };

  return (
    <div>
      <FacebookLogin
        appId="730655258288890" // replace with your actual Facebook App ID
        autoLoad={true}
        fields="name"
        callback={responseFacebook}
      />
      {profile ? (
        <div>
          <h1>{profile.name}</h1>
        </div>
      ) : (
        ""
      )}
    </div>
  );
};

export default MyApp;
